import './App.css';
import Names from "./Names";

function returnName() {
    const names = ['Peggy', 'Elly', 'Felipe'];

    return names[Math.floor(Math.random() * names.length)];
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
            <Names />
        </p>
          <button onClick={returnName}>
              Button
          </button>
      </header>
    </div>
  );
}

export default App;
